BEGIN TRANSACTION;
CREATE EXTENSION POSTGIS;
CREATE TABLE office (
    handle varchar(60),
    bioguide_id varchar(7),
    type varchar(8),
    name varchar(50),
    line1 varchar(255),
    line2 varchar(255),
    city varchar(100),
    state_code varchar(2),
    zip varchar(10),
    phone varchar(14),
    latlng geography
);
CREATE TABLE rep (
    bioguide_id varchar(7),
    first_name varchar(50),
    last_name varchar(50),
    state_code varchar(2),
    state_name varchar(50),
    district_number integer,
    district_code varchar(4),
    district_ordinal varchar(8),
    party varchar(20),
    chamber varchar(10),
    title varchar(20),
    title_short varchar(4),
    website varchar(255)
);
COMMIT;